import React, { useState, useEffect } from 'react';
import AOS from 'aos';
import 'aos/dist/aos.css';
import '../../assets/css/dashboard.css';
import WelcomeCard from '../../components/dashboard/WelcomeCard';
import SummaryCards from '../../components/dashboard/SummaryCards';
import Charts from '../../components/dashboard/Charts';
import QuickActions from '../../components/dashboard/QuickActions';
import AllFeatures from '../../components/dashboard/AllFeatures';
import QuickActionModal from '../../components/dashboard/QuickActionModal';
import RecentTransactions from '../../components/dashboard/RecentTransactions';

const DashboardPage: React.FC = () => {
    const [isModalOpen, setModalOpen] = useState(false);

    useEffect(() => {
        AOS.init();
    }, []);

    return (
        <div className="p-6 bg-gray-50 min-h-screen">
            <div className="grid grid-cols-1 lg:grid-cols-3 gap-6">
                {/* Ana İçerik Alanı */}
                <div className="lg:col-span-2 space-y-6">
                    <div>
                        <h1 className="text-2xl font-bold text-gray-800">Dashboard</h1>
                        <p className="text-gray-500">Hoş geldin! Finansal durumuna göz at.</p>
                    </div>
                    <WelcomeCard />
                    <div className="bg-gray-800 text-white p-6 rounded-xl flex justify-between items-center">
                        <h2 className="text-lg font-semibold">Xtreme AI Hazır! Hemen Dene... Yapay Zekaya Danış →</h2>
                        <div className="flex gap-2">
                            <input type="email" placeholder="Your Email" className="px-3 py-1 rounded-md text-gray-800" />
                            <button className="bg-blue-500 hover:bg-blue-600 text-white px-3 py-1 rounded-md">Subscribe</button>
                        </div>
                    </div>
                    <SummaryCards />
                    <div className="grid grid-cols-1 xl:grid-cols-12 gap-6">
                        <div className="xl:col-span-8">
                           <Charts />
                        </div>
                        <div className="xl:col-span-4">
                           <RecentTransactions />
                        </div>
                    </div>
                    <QuickActions />
                    <AllFeatures />
                </div>

                {/* Sağ Kenar Çubuğu */}
                <div className="space-y-6">
                    <div className="bg-purple-700 text-white p-4 rounded-lg shadow-lg">
                        <div className="flex justify-between items-center">
                            <div>
                                <p className="font-bold">Tarragona</p>
                                <p className="text-xs">Cloudy</p>
                            </div>
                            <div className="flex items-center">
                                <p className="text-4xl font-bold">32°</p>
                                <p className="text-2xl ml-2">☁️</p>
                            </div>
                        </div>
                    </div>
                    <div className="bg-gray-800 text-white p-5 rounded-lg shadow-lg">
                        <div className="flex justify-between items-start">
                            <div>
                                <p className="text-xs text-gray-400">MEVCUT KASA</p>
                                <p className="text-xs text-gray-500">09:20AM 04 Jan</p>
                            </div>
                            <p className="text-green-400 text-sm font-semibold">▲ 2.89%</p>
                        </div>
                        <p className="text-3xl font-bold my-3">₺1,567</p>
                        <div className="w-full bg-gray-700 rounded-full h-1.5">
                            <div className="bg-blue-500 h-1.5 rounded-full" style={{width: '80%'}}></div>
                        </div>
                        <div className="flex justify-between text-xs text-gray-500 mt-1">
                            <span>0%</span>
                            <span>8%</span>
                        </div>
                    </div>
                </div>
            </div>
             <QuickActionModal isOpen={isModalOpen} onClose={() => setModalOpen(false)} />
        </div>
    );
};

export default DashboardPage;
